import{_ as e,c as s,o as a,ag as i}from"./chunks/framework.CQuhCYrb.js";const g=JSON.parse('{"title":"Agent Runs","description":"","frontmatter":{},"headers":[],"relativePath":"features/agent-runs.md","filePath":"features/agent-runs.md"}'),n={name:"features/agent-runs.md"};function o(r,t,l,d,h,c){return a(),s("div",null,[...t[0]||(t[0]=[i('<h1 id="agent-runs" tabindex="-1">Agent Runs <a class="header-anchor" href="#agent-runs" aria-label="Permalink to &quot;Agent Runs&quot;">​</a></h1><p>The Agent Runs view shows the history of all agent sessions in your workspace. It&#39;s where you track what your agents have done, review their outputs, and manage session history.</p><h2 id="accessing-agent-runs" tabindex="-1">Accessing Agent Runs <a class="header-anchor" href="#accessing-agent-runs" aria-label="Permalink to &quot;Accessing Agent Runs&quot;">​</a></h2><p>Click <strong>Agent Runs</strong> in the sidebar or press <code>Ctrl+6</code> to open the view.</p><h2 id="session-list" tabindex="-1">Session List <a class="header-anchor" href="#session-list" aria-label="Permalink to &quot;Session List&quot;">​</a></h2><p>The main panel shows all agent sessions with:</p><table tabindex="0"><thead><tr><th>Column</th><th>Description</th></tr></thead><tbody><tr><td><strong>Agent</strong></td><td>Which agent ran (with icon)</td></tr><tr><td><strong>Status</strong></td><td>Current state of the session</td></tr><tr><td><strong>Started</strong></td><td>When the session began</td></tr><tr><td><strong>Duration</strong></td><td>How long it ran</td></tr><tr><td><strong>Linked Ticket</strong></td><td>Associated ticket (if any)</td></tr></tbody></table><h3 id="session-statuses" tabindex="-1">Session Statuses <a class="header-anchor" href="#session-statuses" aria-label="Permalink to &quot;Session Statuses&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Status</th><th>Meaning</th></tr></thead><tbody><tr><td><strong>Running</strong></td><td>Agent is currently working</td></tr><tr><td><strong>Completed</strong></td><td>Finished successfully</td></tr><tr><td><strong>Failed</strong></td><td>Ended with an error</td></tr><tr><td><strong>Cancelled</strong></td><td>Stopped by user</td></tr><tr><td><strong>Waiting</strong></td><td>Paused for input or approval</td></tr></tbody></table><h2 id="session-details" tabindex="-1">Session Details <a class="header-anchor" href="#session-details" aria-label="Permalink to &quot;Session Details&quot;">​</a></h2><p>Click a session to view its details:</p><h3 id="messages-tab" tabindex="-1">Messages Tab <a class="header-anchor" href="#messages-tab" aria-label="Permalink to &quot;Messages Tab&quot;">​</a></h3><p>Shows the full conversation:</p><ul><li>User prompts</li><li>Agent responses</li><li>Tool calls with inputs and results</li><li>Thinking blocks (if extended thinking was enabled)</li></ul><h3 id="output-tab" tabindex="-1">Output Tab <a class="header-anchor" href="#output-tab" aria-label="Permalink to &quot;Output Tab&quot;">​</a></h3><p>Shows the structured output from the agent (if the agent has an output schema defined).</p><h3 id="activity-tab" tabindex="-1">Activity Tab <a class="header-anchor" href="#activity-tab" aria-label="Permalink to &quot;Activity Tab&quot;">​</a></h3><p>Shows a timeline of events:</p><ul><li>When the session started</li><li>Tool executions</li><li>Permission requests</li><li>Errors or warnings</li><li>When it completed</li></ul><h2 id="actions" tabindex="-1">Actions <a class="header-anchor" href="#actions" aria-label="Permalink to &quot;Actions&quot;">​</a></h2><h3 id="continue-session" tabindex="-1">Continue Session <a class="header-anchor" href="#continue-session" aria-label="Permalink to &quot;Continue Session&quot;">​</a></h3><p>If a session is waiting for input or was paused, click <strong>Continue</strong> to resume it.</p><h3 id="fork-session" tabindex="-1">Fork Session <a class="header-anchor" href="#fork-session" aria-label="Permalink to &quot;Fork Session&quot;">​</a></h3><p>Create a new branch from any point in the session:</p><ol><li>Find the message you want to branch from</li><li>Click the fork icon</li><li>Enter your new prompt</li><li>A new session starts from that point</li></ol><h3 id="link-to-ticket" tabindex="-1">Link to Ticket <a class="header-anchor" href="#link-to-ticket" aria-label="Permalink to &quot;Link to Ticket&quot;">​</a></h3><p>Associate a session with a ticket:</p><ol><li>Click the session options menu</li><li>Select <strong>Link to Ticket</strong></li><li>Choose a ticket from the dropdown</li></ol><p>The session will appear in the ticket&#39;s Sessions tab.</p><h3 id="archive" tabindex="-1">Archive <a class="header-anchor" href="#archive" aria-label="Permalink to &quot;Archive&quot;">​</a></h3><p>Archive completed sessions to keep your workspace clean:</p><ol><li>Click the session options menu</li><li>Select <strong>Archive</strong></li><li>Optionally link to a ticket for reference</li></ol><p>Archived sessions remain accessible from linked tickets.</p><h2 id="filtering" tabindex="-1">Filtering <a class="header-anchor" href="#filtering" aria-label="Permalink to &quot;Filtering&quot;">​</a></h2><p>Filter the session list by:</p><table tabindex="0"><thead><tr><th>Filter</th><th>Options</th></tr></thead><tbody><tr><td><strong>Agent</strong></td><td>Show sessions for a specific agent</td></tr><tr><td><strong>Status</strong></td><td>Filter by status (Running, Completed, Failed, etc.)</td></tr><tr><td><strong>Time</strong></td><td>Today, This Week, This Month, All</td></tr><tr><td><strong>Ticket</strong></td><td>Show sessions linked to a specific ticket</td></tr></tbody></table><h2 id="bulk-actions" tabindex="-1">Bulk Actions <a class="header-anchor" href="#bulk-actions" aria-label="Permalink to &quot;Bulk Actions&quot;">​</a></h2><p>Select multiple sessions to:</p><ul><li>Archive them together</li><li>Delete them</li><li>Export their outputs</li></ul><h2 id="comparison-with-chat" tabindex="-1">Comparison with Chat <a class="header-anchor" href="#comparison-with-chat" aria-label="Permalink to &quot;Comparison with Chat&quot;">​</a></h2><p>Agent Runs and Chat both show conversations with Claude, but:</p><table tabindex="0"><thead><tr><th>Agent Runs</th><th>Chat</th></tr></thead><tbody><tr><td>Sessions with defined agents</td><td>Free-form conversations</td></tr><tr><td>Structured input/output</td><td>Natural conversation</td></tr><tr><td>Often automated or triggered</td><td>Always user-initiated</td></tr><tr><td>Shows in Agent Runs view</td><td>Shows in Chat view</td></tr></tbody></table><p>Both can be linked to tickets and both support branching.</p><h2 id="related" tabindex="-1">Related <a class="header-anchor" href="#related" aria-label="Permalink to &quot;Related&quot;">​</a></h2><ul><li><a href="/features/agents.html">AI Agents</a> for creating and configuring agents</li><li><a href="/features/ticketing.html">Tickets</a> for linking sessions to work items</li><li><a href="/features/chat.html">Chat</a> for free-form conversations</li></ul>',45)])])}const p=e(n,[["render",o]]);export{g as __pageData,p as default};
